var elncn,elnncn,upcn=0,tosave=[],toload=[[""]],b64="";function exportSave(){b64=b64Encode(JSON.stringify([[elncn,elnncn,upcn],[0,0,tosave],"["+JSON.stringify(toload)+"]"]))}function b64Encode(e){return window.btoa(unescape(encodeURIComponent(e)))}function b64Decode(e){return decodeURIComponent(escape(window.atob(e)))}function loadInfo(e){e=JSON.parse(b64Decode(e));elncn=e[0][0],elnncn=e[0][1],upcn=e[0][2],tosave=e[1][2],toload=e[2]}function updateIds(){document.getElementById("elncns").value=elncn,document.getElementById("elnncns").value=elnncn,document.getElementById("upcns").value=upcn,document.getElementById("tosaves").value=tosave,document.getElementById("toloads").value=toload,document.getElementById("b64s").value=b64}function updateVars(){elncn=document.getElementById("elncns").value,elnncn=document.getElementById("elnncns").value,upcn=document.getElementById("upcns").value,tosave=document.getElementById("tosaves").value,toload=document.getElementById("toloads").value,b64=document.getElementById("b64s").value}